export default function Appli() {

  pages = useFetch('http://localhost:8080/projet-web-5w5/index.php/wp-json/wp/v2/pages');

  return (
    <div className="Appli">
      <Header></Header>
      <Routes>
        <Route path='/' element={<Posts />}></Route>
        <Route path='/cours' element={<Classes />}></Route>
      </Routes>
    </div>
  );
}
